import React from "react";

function NameList() {
        const persons = [
                {
                        id: 1,
                        name: 'sravan',
                        age: 24,
                        skill:'react'
                },
                {
                        id: 2,
                        name: 'krishna',
                        age: 24,
                        skill: 'angular'
                },
                {
                        id: 3,
                        name: 'kumar',
                        age: 24,
                        skill: 'native'
                },
                {
                        id: 4,
                        name: 'reddy',
                        age: 24,
                        skill: 'node'
                }
        ];
        const personList = persons.map(person =>
                <h2>i am {person.name}.I am {person.age} years old and i know {person.skill}
                </h2>
        )
  return <div>{personList}</div>
 
  
}

export default NameList;

const names = ["sravan", "krishna", "samara"];
